import styled from 'styled-components';

const NavComp = styled.nav`
  .container {
    width: 900px;
    height: 1200px;
    padding: 10px;
    margin: 0 auto;
    margin-top: 150px;
    border: 1px solid rgb(230, 230, 230);
  }
`;
export default NavComp;
